  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1999-2016. National Association of Attorneys
  General (NAAG). Policyu00e2u0080u0094Tobacco Settlement Payments. The National Association
  of Attorneys General (NAAG) provides Tobacco Settlement Revenue data for 46 states
  participating in the Master Settlement Agreement (MSA) with the four largest tobacco
  companies in the United States.  Data are reported on an annual basis.  Four states
  (Florida, Minnesota, Mississippi and Texas) provide the STATE System their Tobacco
  Settlement Revenue data independently.</p>n\",\n\t\"license_title\": \"Other License
